import React, { Component} from 'react';
import{Table, TableCell, TableHead, TableRow, AppBar} from '@material-ui/core';
import Header from '../components/Header';
import '../css/App.css';
import {BrowserRouter as Router} from 'react-router-dom';

class MainList extends Component{
    render(){
        return (
            <Router>
                <div display="flex" alignItems="center" justify="center">
                    <AppBar position="static">
                        <div><Header /></div>
                    </AppBar>
                    <br/>

                    <h3 align="center"> 게시판 목록 </h3>
                    <Table>
                        <TableHead>
                            <TableRow>
                                <TableCell><b>NO</b></TableCell>
                                <TableCell><b>TITLE</b></TableCell>
                                <TableCell><b>CONTENT</b></TableCell>
                                <TableCell><b>EMAIL</b></TableCell>
                                <TableCell><b>REGDATE</b></TableCell>
                            </TableRow>
                        </TableHead>
                    </Table>


                </div>
            </Router>

        )
    }

}

export default MainList;
